public class InnerDataSourceSharePointDataSourceConfigurationFactory(Action<Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration>
{

    internal InnerDataSourceSharePointSourceConfigurationFactory SourceConfigurationFactory { get; set; }

    internal InnerDataSourceSharePointCrawlerConfigurationFactory CrawlerConfigurationFactory { get; set; }

    protected override Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration Create()
    {
        var sharePointDataSourceConfigurationResult = CreateSharePointDataSourceConfiguration();
        factoryAction?.Invoke(sharePointDataSourceConfigurationResult);

        return sharePointDataSourceConfigurationResult;
    }

    private Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration CreateSharePointDataSourceConfiguration()
    {
        var sharePointDataSourceConfigurationResult = new Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration();

        return sharePointDataSourceConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Bedrock.DataSourceTypes.SharePointDataSourceConfiguration result)
    {
        base.CreateChildren(result);

        result.SourceConfiguration ??= SourceConfigurationFactory?.Build();
        result.CrawlerConfiguration ??= CrawlerConfigurationFactory?.Build();
    }

} // End Of Class

